import { useEffect , useRef } from "react";
import React from "react";
import Typed from "typed.js";

const Home = () => {
    const typedRef = useRef();

  useEffect(() => {
    const typedInstance = typedRef.current;
    // You can access the Typed instance here and call its methods if needed
  }, []);
  return (
    <>
      <div className="container d-flex">
        <div className="container text-center">
          <div className="container">Hey , I am <span class="text-primary">Nitin Patil</span>
          <div>And I am Passionate </div>
          <span className="text-primary">
            <Typed ref={typedRef} strings={["Web Developer", "Web Designer"]} typeSpeed={50} />
          </span></div>
        </div>
        <div className="container text-center"></div>
      </div>
    </>
  );
};

export default Home;
